import styled from 'styled-components';
import { Link } from 'react-router-dom';

export const Container = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 25px 0;
  > a figure img {
    width: 100%;
    max-width: 275px;
  }
`;

export const Cart = styled(Link)``;
